text:
 @evoo22k_56  O Bahia foi rebaixado culpa de quem senhor?
O VAR só está pra ajudar(Embora atrapalhem pra Krl)
O Bahia foi rebaixado pq jogou mal o Campeonato inteiro,o Bahia não teve 1,não teve 2 e nem 3 partidas pra sair da degola,o Bahia assim como os demais teve 38 rodadas para escapar do Rebaixamento,o Bahia não escapou pq jogou mal,e não é de hoje que o Bahia joga mal,o ano passado o Bahia escapou por muito pouco,mas dessa vez não deu,mano o Bahia foi rebaixado não foi por nenhum Árbitro é VAR não,o Bahia foi rebaixado pq foi incompetente e jogou mal pra Caralho,não é atoa que foi o 3° Pior time desse Brasileirão,vcs estavam ganhando de 2 a 0 do Atlético MG,em 5 minuto vcs conseguem levar 3 gols,aí é pedir pra ser rebaixado né?

 @evoo22k_56  Cara o Bahia foi rebaixado porque jogou mal pra Caralho,jogou mais mal do que O Cruzeiro em 2019,não é atoa que o Bahia foi o 3° Pior time,e o Bahia briga pra não ser rebaixado não é de hoje não viu,desde 2019 o Bahia briga pra não cair,2019 o Bahia chegou a ficar em 6° mas caiu é brigou pra não cair de novo,2020 escapou soando o rego,e dessa vez foi pior que o ano passado,o time não foi rebaixado por causa de VAR nenhum não,o Bahia foi rebaixado pq mereceu,jogou como sempre,perdeu como sempre!
Cara o Bahia estava ganhando de 2 a 0 do Atlético MG,em 5 minutos já estava 3 a 2 pro Atlético MG,aí eu te pergunto:Isso é culpa de VAR?
O Futebol vergonhoso do Bahia é culpa do VAR?Não,né?

 @J_Jr12  Futebol brasileiro ultimamente tá um lixo, o europeu tbm ta uma porcaria. Parece que as peneiras estão sendo feitas por jogadores de totó. Pq cadê os craques de bola nas outras seleções. 20 anos atrás tínhamos feras pra tudo que é posição. Bola de Ouro e melhor do mundo fifaa era uma coisa de louco. Hj ninguém bate de frente com Messi e Cr7. Os dois vão aposentar e ainda vão continuar ganhando bola de Ouro kkkkkkkk.
Mbappe já era pra ter levado uma bola de ouro pelo menos(2018).
João felix é mediano, Bruno Fernandes mediano, Haaland é um goleador mas não um craque, Vinicius Júnior por enquanto tá iludindo igual o Robinho, Harvetz não vejo esse futebol todo que a mídia farofeira diz.

