 @jirenkkj3311  Cara vc é cego?
A bola pega na mão do jogador do Bahia
E pegou na mão do jogador Baiano com o Braço aberto!

 @J_Jr12  1 milhão e 500 mil de salário. É um absurdo pela bolinha que esse cara joga. Tem seus méritos jogou na Europa em grandes clubes, seleção.
Mas na idade que está não ele não garante conquista de títulos. Coitado do time que comprar ele aqui no Brasil.
Atlético Mineiro, Flamengo e Palmeiras fiquem de olhos abertos para não cair em golpe com esse picareta.

 @thetruth810  Sim o time foi mal durante o campeonato. Mas eu fico louco quando os times são roubados por essa porcaria de var. 5 arbitros dentro de uma cabine e ainda são incompetentes, desconhecem a regra (que a m&rd@ da Fifa vive mudando sem necessidade alguma)
A Fifa tinha que vir pra verificar pq tanto erros consecutivos. Por isso um dos motivos do futebol ser mau visto na Europa pela arbitragem amadora. 
São 38 rodadas cagadas pela arbitragem, todo ano os 20 times das series A são saqueados pelo amadorismo da arbitragem. Fora as lambanças nas outras competições.
